import React, { Fragment } from "react";

import "./NavigationBar.css";

const NavigationBar = () => {
  return (
    <Fragment>
      <nav className="navigation-bar">
        <img className="navigation-logo" alt="logo" src="logo.png" />
        <a href="#">Features</a>
        <a href="#">Team</a>
        <a href="#">Download</a>
      </nav>
    </Fragment>
  );
};

export default NavigationBar;
